import React from "react";

function AddForm({
  label,
  newEntry,
  setNewEntry,
  onSubmit,
  newEntryLength,
  setNewEntryLength,
}) {
  return (
    <form onSubmit={onSubmit}>
      <input
        type="text"
        placeholder={label}
        value={newEntry}
        onChange={(event) => setNewEntry(event.target.value)}
      />
      {newEntryLength !== undefined && (
        <input
          type="text"
          placeholder="Song Length"
          value={newEntryLength}
          onChange={(event) => setNewEntryLength(event.target.value)}
        />
      )}
      <button type="submit">Add</button>
    </form>
  );
}

export default AddForm;
